function assginObject(){var n={},t=arguments.length;if(0===t)return console.warn("no object to assgin"),null;for(var e=0;e<t;e++)if("Object"===Object.prototype.toString.call(arguments[e]).slice(8,-1))for(j in arguments[e])n[j]=arguments[e][j];else console.warn(e+"th argument is not a pure object");return n}